import image1 from "../assets/t-image1.png";
import image2 from "../assets/t-image2.jpg";
import image3 from "../assets/t-image3.jpg";

export const testimonialsData = [
  {
    image: image1,
    review:
      "My motto is to inspire and be inspired. I take up the challenge every single day to motivate and inspire at least one person to embrace the fit life.",
    name: 'ABC',
    status : 'COACH'
  },
  {
    image: image2,
    review: "I made the right choice by choosing the Fitclub and by choosing the right plan and program I already achieved my ideal body!",
    name: 'XYZ',
    status: 'ENTREPRENEUR'
  },
  {
    image : image3,
    review:' Hands down, best choice I’ve made training at FitClub. VERY friendly team who make me actually want to go train',
    name: 'PQR',
    status: "CUSTOMER"
  }
];
